pragma solidity ^0.8.3;

contract RegSC {
    
    struct Farmer { 
       uint f_id ;
       uint farmArea;
       uint schemeAmount;
       string name;
       string farmLocation;
       string cropType;
   }
    
    
    struct Insurance_Company {
        uint ic_id;
        string name;
        string company_type;
    }
    
    struct Specialist {
        uint s_id;
        string name;
        string experience;
    }
    
    struct Government_Agencies {
        uint g_id;
        string name;
    }
    
    struct Cold_Storage {
        uint c_id;
        uint capacity;
        string name;
        string location;
    }
    
    Farmer[] farmer;
    Insurance_Company[] insurance_company;
    Specialist[] specialist;
    Government_Agencies[] government_agencies;
    Cold_Storage[] cold_storage;
    
    
    function newFarmer( uint farmArea, string memory name, string memory farmLocation, string memory cropType) public {
        farmer.push(Farmer({f_id: farmer.length + 1, farmArea: farmArea,schemeAmount: 0, name: name, farmLocation: farmLocation, cropType: cropType }));
       
    }
    
    function newInsuranceCompany( string memory name, string memory company_type) public {
       insurance_company.push(Insurance_Company({ic_id: insurance_company.length + 1, name: name, company_type: company_type})); 
      
    }
    
    function newSpecialist( string memory name, string memory experience) public {
        specialist.push(Specialist({s_id: specialist.length + 1, name: name, experience: experience}));
       
    }
    
    function newGovernmentAgencies( string memory name) public {
        government_agencies.push(Government_Agencies({g_id: government_agencies.length + 1, name: name}));
     
    }
    
    function newColdStorage(uint capacity, string memory name, string memory location) public {
        cold_storage.push(Cold_Storage({c_id: cold_storage.length + 1, name: name, capacity: capacity, location: location}));
      
    }
    
    function viewFarmer( uint f) public view returns(uint, uint, uint, string memory, string memory, string memory)
    {
        for(uint id=0;id<=farmer.length;id++){
            if(f==farmer[id].f_id){
               return(farmer[id].f_id, farmer[id].farmArea, farmer[id].schemeAmount, farmer[id].name, farmer[id].farmLocation, farmer[id].cropType); 
            }
         
            
        }
    }
    
    function viewInsuranceCompany( uint ic) public view returns(uint, string memory, string memory)
    {
        for(uint id=0;id<= insurance_company.length;id++){
            if(ic== insurance_company[id].ic_id){
               return( insurance_company[id].ic_id,  insurance_company[id].name,  insurance_company[id].company_type); 
            }
        }
    }
    
    function viewSpecialist( uint s) public view returns(uint, string memory, string memory)
    {
        for(uint id=0;id<=specialist.length;id++){
            if(s==specialist[id].s_id){
               return(specialist[id].s_id, specialist[id].name, specialist[id].experience); 
            }
        }
    }
    
    function viewGovernmentAgencies( uint g) public view returns(uint, string memory)
    {
        for(uint id=0;id<=government_agencies.length;id++){
            if(g==government_agencies[id].g_id){
               return(government_agencies[id].g_id, government_agencies[id].name); 
            }
        }
    }
    
    function viewColdStorage( uint c) public view returns(uint, uint, string memory, string memory)
    {
        for(uint id=0;id<=cold_storage.length;id++){
            if(c==cold_storage[id].c_id){
               return(cold_storage[id].c_id, cold_storage[id].capacity, cold_storage[id].name, cold_storage[id].location); 
            }
        }
    }
}

